import React, { useState } from 'react'
import Rotator from './components/rotator';
import './App.css';
import logo from './images/logo.svg'

function App(props) {
  return (
    <>
      <img src={logo} className='Rotator'/>

      <Rotator className="Rotator"/>
    </>
  );  
}

export default App;
